import React from 'react';
import Card from './Card';

const Main = () => {
    return (
        <div className='container-card'>
            {
                get_data.map((res, pos) => {
                    return (
                        <Card info={res} key={pos} />
                    )
                })
            }
        </div>
    );
}

export default Main;
